import { StyleSheet } from "react-native";

export const gameCardThumbnailBorderColor = "#EAEADF";
export const gameTitleTextColor = "#EAEADF";
export const gameCardLogoBorderColor = "rgba(234, 234, 223, 0.6)";
export const gameCardBackgroundColor = "#161E2C";
export const gameCardShadowColor = "#000000";
export const subtitleTextColor = "#EAEADF";

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#111",
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "row",
  },
  separator: {
    marginRight: 40,
  },
});

export default styles;
